package cn.com.evo.integration.guangxi.content.xml.model;import javax.xml.bind.annotation.XmlElement;import javax.xml.bind.annotation.XmlRootElement;import javax.xml.bind.annotation.XmlType;/** * @Description: * @author: lu.xin * @create: 2019-03-05 4:08 PM **/@XmlRootElement(name = "ADI")@XmlType(propOrder = {        "metadata",        "assets"})public class ADI {    private Metadata metadata;    private Assets assets;    public ADI() {    }    public ADI(Metadata metadata, Assets assets) {        this.metadata = metadata;        this.assets = assets;    }    @XmlElement(name = "Metadata")    public Metadata getMetadata() {        return metadata;    }    @XmlElement(name = "Asset")    public Assets getAssets() {        return assets;    }    public void setMetadata(Metadata metadata) {        this.metadata = metadata;    }    public void setAssets(Assets assets) {        this.assets = assets;    }}